New Pacwyn 20 is here - it's a pack opener game you must to try right now!

A lot of squad building challenges, amazing pack opening system, exclusive objectives - there is everything for you in the game.

Improve your squad day by day, play matches with opponents from over the world and become the best Pacwyn player.

Pacwyn Football Draft and Pack Opener offers:
1. Making collections of football players;
2. Regular pack opening events, including flash and lightning rounds;
3. Joining associations/clans with your friends to become stronger;
4. Building squads and playing online matches against different opponents;
5. Completing Daily and Weekly Objectives to receive awesome rewards;
6. Draft players to try different tactics in your matches;
7. Play Weekend Tournaments to move to TOP 1 in the WorldWide Leaderboard;
8. Trading with others users for more stuff.

Pacwyn 20 has a great community of users, join us right now!

This application’s sole purpose is to help its users learn how to build the best drafts and squads, find out more about football players and updates. This application is not endorsed by or affiliated with Electronic Arts Inc or other incorporations. All trademarks and copyrights belong to their respective owners.
